# Record test cases that pass / fail 
passes = []
fails = []

# Performance montior 
profiler = cProfile.Profile()

for data in route_data:
    # Known dataset 
    starttime = time.time()
    # Make move 
    profiler.enable()
    response = handle_move(data[3], silent)
    profiler.disable()
    
    # Measure time 
    endtime = time.time()
    diff = 1000 * (time.time() - starttime) 
    if (diff > timepanic):
        timediff = "{:.2f} ms".format(diff)
        print ("WARN %s. %s exceeds %s ms. Use Case: %s" % (data[0], timediff, timepanic, data[2]))
        warn += 1 

    if response["move"] == '':
        # Performance test 
        pass 

    else:
        if response["move"] in data[1]: 
            # PASS -- Expected result
            # print("PASS %s. Went %s. Expected %s. Strategy: %s" % (str(response["move"]), data[1], data[2]))
            passes.append(data[0])
            success += 1 
            
            if (data[0] in failed_prev) or not (data[0] in passed_prev):
                solved += 1
                print("SOLVED %s. %s" % (data[0], data[1]))
                solved_list.append(data[0])

        else:
            # FAIL -- Unexpected result 
            print("FAIL %s. Went %s. Expected %s. Strategy: %s" % (data[0], str(response["move"]), data[1], data[2]))
            printBoard(data[3])
            fails.append(data[0])
            fail += 1

            if (data[0] in passed_prev) or not (data[0] in failed_prev):

                regression += 1
                print("REGRESSION %s. %s" % (data[0], data[2]))
                regression_list.append(data[0])


